import * as React from 'react';
import { fetchfeedback } from '../rtk/Slices/Feedback';
import { AppDispatch, RootState } from '../rtk/Store';
import { TypedUseSelectorHook, useDispatch, useSelector } from 'react-redux';
import { fetchsignIn } from '../rtk/Slices/UserSlice';
import { TextField, Avatar } from '@mui/material';
import { Card, CardContent, Skeleton, Stack, Box, Button, IconButton, Textarea, Typography } from '@mui/joy';
import { useParams } from 'react-router-dom';
export default function Reviews() {
    const params = useParams()
    const dispatch = useDispatch<AppDispatch>()
    React.useEffect(() => {
        dispatch(fetchfeedback());
        dispatch(fetchsignIn())
    }, [dispatch]);
    const selector: TypedUseSelectorHook<RootState> = useSelector
    const feedback = selector((state) => {
        return state.FeedbackSlice.feedback;
    });

    const feedbackProduct = feedback.filter((i) => {
        return i.idProduct == params.id
    })

    const loading = selector((state) => {
        return state.FeedbackSlice.loading;
    });
    const users = selector((state) => {
        return state.signInlice.SignIn;
    });

    const loadingUsers = selector((state) => {
        return state.signInlice.loading;
    });
    if (localStorage.getItem("user")) {

    }
    let user = users.find((i) => {
        return JSON.parse(localStorage.getItem("user")!) && (i.id == JSON.parse(localStorage.getItem("user")!).id)
    })
    const [text, setText] = React.useState('');
    const [name, setName] = React.useState(user?.name || "");
    const [email, setEmail] = React.useState(user?.email || "");
    const [e, setE] = React.useState(false);

    const addEmoji = (emoji: string) => () => setText(`${text}${emoji}`);

    function addComment(e: React.MouseEvent<HTMLAnchorElement, MouseEvent>) {
        e.preventDefault();
        fetch(`https://isotechdata.onrender.com/feedback`, {
            method: "POST",
            headers: {
                "Content-Type": "application/json",
            },
            body: JSON.stringify({
                id: Date.now(),
                date: `${["January", "February", "March", "April", "May", "June",
                    "July", "August", "September", "October", "November", "December"
                ][(new Date()).getMonth()]} ${(new Date()).getUTCDate()}, ${(new Date()).getUTCFullYear()}`,
                idProduct: params.id,
                img: "data:image/png;base64,",
                user: name,
                comment: text,
                idUser: JSON.parse(localStorage.getItem("user")!) ? JSON.parse(localStorage.getItem("user")!).id : Date.now()
            }),
        })
            .then((res) => res.json()).then((r) => {
                dispatch(fetchfeedback());
            })
    }
    return (
        <>
            {loadingUsers &&
                <>
                    <Box component={"form"} width={"100%"} boxSizing={"border-box"}>
                        <Stack direction={"row"} gap={2} mb={"10px"} flexWrap={"wrap"} >
                            <TextField
                                id="outlined-controlled"
                                label="Name"

                                defaultValue={user?.name}
                                sx={{ width: "250px", flexGrow: "1", background: "white", height: "55px", mb: "23px" }}
                                onChange={(event: React.ChangeEvent<HTMLInputElement>) => {
                                    setName(event.target.value);
                                    setE(false)
                                }}
                                required
                                helperText="Please enter your name"
                                error={e === true}

                            />
                            <TextField
                                id="outlined-uncontrolled"
                                label="Email"
                                sx={{ width: "250px", flexGrow: "1", background: "white", height: "55px", mb: "23px" }}
                                defaultValue={user?.email}
                                onChange={(event: React.ChangeEvent<HTMLInputElement>) => {
                                    setEmail(event.target.value);
                                }}
                            />
                        </Stack>
                        <Textarea
                            placeholder="Type in here…"
                            value={text}
                            onChange={(event) => setText(event.target.value)}
                            minRows={2}
                            maxRows={4}
                            startDecorator={<Box sx={{ display: 'flex', gap: 0.5, flex: 1, flexWrap: "wrap" }}>
                                <IconButton variant="outlined" color="neutral" onClick={addEmoji('👍')} aria-labelledby="emoji">
                                    👍
                                </IconButton>
                                <IconButton variant="outlined" color="neutral" onClick={addEmoji('😍')} aria-labelledby="emoji">
                                    😍
                                </IconButton>
                                <IconButton variant="outlined" color="neutral" onClick={addEmoji('🎊')} aria-labelledby="emoji">
                                    🎊
                                </IconButton>
                                <IconButton variant="outlined" color="neutral" onClick={addEmoji('😘')} aria-labelledby="emoji">
                                    😘
                                </IconButton>
                                <IconButton variant="outlined" color="neutral" onClick={addEmoji('🤣')} aria-labelledby="emoji">
                                    🤣
                                </IconButton>
                                <IconButton variant="outlined" color="neutral" onClick={addEmoji('🥳')} aria-labelledby="emoji">
                                    🥳
                                </IconButton>
                                <IconButton variant="outlined" color="neutral" onClick={addEmoji('😡')} aria-labelledby="emoji">
                                    😡
                                </IconButton>
                                <IconButton variant="outlined" color="neutral" onClick={addEmoji('😤')} aria-labelledby="emoji">
                                    😤
                                </IconButton>
                                <Button variant="outlined" color="neutral" aria-labelledby="send" type='submit' onClick={(e) => {
                                    e.preventDefault()
                                    if (name == "") {
                                        setE(true)
                                    }
                                    else {
                                        addComment(e)
                                        setText("")
                                    }
                                }} sx={{ ml: 'auto' }}>
                                    SEND
                                </Button>
                            </Box>}
                            endDecorator={<Typography level="body-xs" sx={{ ml: 'auto' }}>
                                {text.length} character(s)
                            </Typography>
                            }
                            sx={{ minWidth: 300 }} />
                    </Box>
                    {
                        feedbackProduct && feedbackProduct.map((f: { date: string, img: string, user: string | number, comment: string | number }) => (
                            <Card

                                variant="outlined"
                                sx={{ width: '100%', borderRadius: 0, '--Card-radius': "15px", my: "8px", boxSizing: "border-box" }}
                            >
                                <CardContent orientation="horizontal">
                                    {loading ? (<Avatar variant='square' sx={{ width: "60px", height: "60px", outline: "1px solid black", padding: "2px" }} >
                                        <img loading="lazy"
                                            alt=''
                                            style={{ width: "60px", height: "60px" }}
                                            src={f.img}

                                        />
                                    </Avatar>) : (<Skeleton variant="rectangular" width={"60px"} height={"60px"} />)}
                                    <div>
                                        {loading ? <Typography fontWeight={"bold"}>{f.user}</Typography> : <Skeleton variant="text" width={100} />}
                                        {loading ? <Typography>{f.date}</Typography> : <Skeleton level='body-sm' variant="text" width={200} />}


                                    </div>
                                </CardContent>
                                <CardContent sx={{ gap: 0.5, mt: 1 }}>
                                    {loading ? <Typography>{f.comment}</Typography> : <><Skeleton level="body-xs" variant="text" width="92%" /><Skeleton level="body-xs" variant="text" width="99%" /><Skeleton level="body-xs" variant="text" width="96%" /></>}
                                </CardContent>
                            </Card>
                        )
                        )}
                </>

            }
        </>
    );
}